    batch_body = {
        "name": str(datetime.datetime.now())+" Batch",
        "enabled": True,
        "schedule_type": "manual",
        "priority": "normal",
        "searches_type": "mixed"
    }
    batch_result = requests.post(
        'https://api.scaleserp.com/batches?api_key='+os.environ.get("scale_serp_key"), json=batch_body)
