def process_results(batch_id):

    list = LeadList.objects.get(batch_id=batch_id)
    count = 0
    unprocessed_results = SearchResult.objects.filter(search__list = list, processed = False)
    for res in unprocessed_results:
        if res.valid == True:
            count+=1
        res.processed = True
        res.save()

    return count


